insert into `oc_t_pages_description` values
(1,'cs_CZ','{WEB_TITLE} - Nový dotaz u vaší položky','<p>Dobrý den {CONTACT_NAME}!</p><p>{USER_NAME} ({USER_EMAIL}, {USER_PHONE}) vám zanechal/a zprávu týkající se vaší položky <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>:</p><p>{COMMENT}</p><p>S pozdravem,</p><p>{WEB_LINK}</p>'),
(1,'en_US','{WEB_TITLE} - Someone has a question about your listing','<p>Hi {CONTACT_NAME}!</p><p>{USER_NAME} ({USER_EMAIL}, {USER_PHONE}) left you a message about your listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>:</p><p>{COMMENT}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(2,'cs_CZ','Prosím potvrďte váš {WEB_TITLE} účet','<p>Dobrý den {USER_NAME},</p><p>Prosím potvrďte vaši registraci kliknutím na následující odkaz: {VALIDATION_LINK}</p><p>Děkujeme!</p><p>S pozdravem,</p><p>{WEB_LINK}</p>'),
(2,'en_US','Please validate your {WEB_TITLE} account','<p>Hi {USER_NAME},</p><p>Please validate your registration by clicking on the following link: {VALIDATION_LINK}</p><p>Thank you!</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(3,'cs_CZ','{WEB_TITLE} - Registrace proběhla úspěšně!','<p>Hi {USER_NAME},</p><p>You\'ve successfully registered for {WEB_LINK}.</p><p>Thank you!</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(3,'en_US','{WEB_TITLE} - Registration successful!','<p>Hi {USER_NAME},</p><p>You\'ve successfully registered for {WEB_LINK}.</p><p>Thank you!</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(4,'cs_CZ','Podívej, co jsem objevil/a na {WEB_TITLE}','<p>Dobrý den {FRIEND_NAME},</p><p>Váš přítel {USER_NAME} vám posílá odkaz na následující položku <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Zpráva:</p><p>{COMMENT}</p><p>S pozdravem,</p><p>{WEB_TITLE}</p>'),
(4,'en_US','Look at what I discovered on {WEB_TITLE}','<p>Hi {FRIEND_NAME},</p><p>Your friend {USER_NAME} wants to share this listing with you <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Message:</p><p>{COMMENT}</p><p>Regards,</p><p>{WEB_TITLE}</p>'),
(5,'cs_CZ','{WEB_TITLE} - Nová položka in the last hour','<p>Dobrý den {USER_NAME},</p><p>Behem poslední hodiny byly vystaveny nové položky. Prohlédněte si nové nabídky:</p><p>{ADS}</p><p>-------------</p><p>Pro zrušení odběru klikněte na následující odkaz: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(5,'en_US','{WEB_TITLE} - New listings in the last hour','<p>Hi {USER_NAME},</p><p>New listings have been published in the last hour. Take a look at them:</p><p>{ADS}</p><p>-------------</p><p>To unsubscribe from this alert, click on: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(6,'cs_CZ','{WEB_TITLE} - Nová položka in the last day','<p>Dobrý den {USER_NAME},</p><p>Behem posledního dne byly vystaveny nové položky. Prohlédněte si nové nabídky:</p><p>{ADS}</p><p>-------------</p><p>Pro zrušení odběru klikněte na následující odkaz: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(6,'en_US','{WEB_TITLE} - New listings in the last day','<p>Hi {USER_NAME},</p><p>New listings have been published in the last day. Take a look at them:</p><p>{ADS}</p><p>-------------</p><p>To unsubscribe from this alert, click on: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(7,'cs_CZ','{WEB_TITLE} - Nová položka in the last week','<p>Dobrý den {USER_NAME},</p><p>Behem posledního týdne byly vystaveny nové položky. Prohlédněte si nové nabídky:</p><p>{ADS}</p><p>-------------</p><p>Pro zrušení odběru klikněte na následující odkaz: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(7,'en_US','{WEB_TITLE} - New listings in the last week','<p>Hi {USER_NAME},</p><p>New listings have been published in the last week. Take a look at them:</p><p>{ADS}</p><p>-------------</p><p>To unsubscribe from this alert, click on: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(8,'cs_CZ','{WEB_TITLE} - Nová položka','<p>Dobrý den {USER_NAME},</p><p>Byla přidána nová položka!</p><p>{ADS}</p><p>-------------</p><p>Pro zrušení odběrů klikněte na: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(8,'en_US','{WEB_TITLE} - New listings','<p>Hi {USER_NAME},</p><p>A new listing has been published, check it out!</p><p>{ADS}</p><p>-------------</p><p>To unsubscribe from this alert, click on: {UNSUB_LINK}</p><p>{WEB_LINK}</p>'),
(9,'cs_CZ','{WEB_TITLE} - Nový komentář','<p>Someone commented on the listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Commenter: {COMMENT_AUTHOR}<br />Commenter\'s email: {COMMENT_EMAIL}<br />Title: {COMMENT_TITLE}<br />Comment: {COMMENT_TEXT}</p>'),
(9,'en_US','{WEB_TITLE} - New comment','<p>Someone commented on the listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Commenter: {COMMENT_AUTHOR}<br />Commenter\'s email: {COMMENT_EMAIL}<br />Title: {COMMENT_TITLE}<br />Comment: {COMMENT_TEXT}</p>'),
(10,'cs_CZ','{WEB_TITLE} - Správa položky {ITEM_TITLE}','<p>Hi {USER_NAME},</p><p>You\'re not registered at {WEB_LINK}, but you can still edit or delete the listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a> for a short period of time.</p><p>You can edit your listing by following this link: {EDIT_LINK}</p><p>You can delete your listing by following this link: {DELETE_LINK}</p><p>If you register as a user, you will have full access to editing options.</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(10,'en_US','{WEB_TITLE} - Edit options for the listing {ITEM_TITLE}','<p>Hi {USER_NAME},</p><p>You\'re not registered at {WEB_LINK}, but you can still edit or delete the listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a> for a short period of time.</p><p>You can edit your listing by following this link: {EDIT_LINK}</p><p>You can delete your listing by following this link: {DELETE_LINK}</p><p>If you register as a user, you will have full access to editing options.</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(11,'cs_CZ','{WEB_TITLE} - Potvrzení vaší nabídky','<p>Hi {USER_NAME},</p><p>You\'re receiving this e-mail because a listing has been published at {WEB_LINK}. Please validate this listing by clicking on the following link: {VALIDATION_LINK}. If you didn\'t publish this listing, please ignore this email.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact e-mail: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(11,'en_US','{WEB_TITLE} - Validate your listing','<p>Hi {USER_NAME},</p><p>You\'re receiving this e-mail because a listing has been published at {WEB_LINK}. Please validate this listing by clicking on the following link: {VALIDATION_LINK}. If you didn\'t publish this listing, please ignore this email.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact e-mail: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(12,'cs_CZ','{WEB_TITLE} - Byla vložena nová nabídka','<p>Dear {WEB_TITLE} admin,</p><p>You\'re receiving this email because a listing has been published at {WEB_LINK}.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact email: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>You can edit this listing by clicking on the following link: {EDIT_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(12,'en_US','{WEB_TITLE} - A new listing has been published','<p>Dear {WEB_TITLE} admin,</p><p>You\'re receiving this email because a listing has been published at {WEB_LINK}.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact email: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>You can edit this listing by clicking on the following link: {EDIT_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(13,'cs_CZ','{WEB_TITLE} - Obnova vašeho hesla','<p>Hi {USER_NAME},</p><p>We\'ve sent you this e-mail because you\'ve requested a password reminder. Follow this link to recover it: {PASSWORD_LINK}</p><p>The link will be deactivated in 24 hours.</p><p>If you didn\'t request a password reminder, please ignore this message. This request was made from IP {IP_ADDRESS} on {DATE_TIME}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(13,'en_US','{WEB_TITLE} - Recover your password','<p>Hi {USER_NAME},</p><p>We\'ve sent you this e-mail because you\'ve requested a password reminder. Follow this link to recover it: {PASSWORD_LINK}</p><p>The link will be deactivated in 24 hours.</p><p>If you didn\'t request a password reminder, please ignore this message. This request was made from IP {IP_ADDRESS} on {DATE_TIME}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(14,'cs_CZ','{WEB_TITLE} - Žádost o změnu emailu','<p>Hi {USER_NAME}</p><p>You\'re receiving this e-mail because you requested an e-mail change. Please confirm this new e-mail address by clicking on the following validation link: {VALIDATION_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(14,'en_US','{WEB_TITLE} - You requested an email change','<p>Hi {USER_NAME}</p><p>You\'re receiving this e-mail because you requested an e-mail change. Please confirm this new e-mail address by clicking on the following validation link: {VALIDATION_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(15,'cs_CZ','{WEB_TITLE} - Prosím potvrďte vaše upozornění','<p>Dobrý den {USER_NAME},</p><p>prosím potvrďte registraci upozornění kliknutím na následující odkaz: {VALIDATION_LINK}</p><p>Děkujeme!</p><p>S pozdravem,</p><p>{WEB_LINK}</p>'),
(15,'en_US','{WEB_TITLE} - Please validate your alert','<p>Hi {USER_NAME},</p><p>Please validate your alert registration by clicking on the following link: {VALIDATION_LINK}</p><p>Thank you!</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(16,'cs_CZ','{WEB_TITLE} - Váš komentář byl schválen','<p> Ahoj {COMMENT_AUTHOR}, </p><p> Váš komentář k <a href=\"{ITEM_URL}\"> {ITEM_TITLE} </a> byl schválen. </p><p> S pozdravem,</p><p> {WEB_LINK} </p>'),
(16,'en_US','{WEB_TITLE} - Your comment has been approved','<p>Hi {COMMENT_AUTHOR},</p><p>Your comment on <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a> has been approved.</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(17,'cs_CZ','{WEB_TITLE} - Potvrzení vaší nabídky','<p>Hi {USER_NAME},</p><p>You\'re receiving this e-mail because you’ve published a listing at {WEB_LINK}. Please validate this listing by clicking on the following link: {VALIDATION_LINK}. If you didn\'t publish this listing, please ignore this e-mail.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact e-mail: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>Even if you\'re not registered at {WEB_LINK}, you can still edit or delete your listing:</p><p>You can edit your listing by following this link: {EDIT_LINK}</p><p>You can delete your listing by following this link: {DELETE_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(17,'en_US','{WEB_TITLE} - Validate your listing','<p>Hi {USER_NAME},</p><p>You\'re receiving this e-mail because you’ve published a listing at {WEB_LINK}. Please validate this listing by clicking on the following link: {VALIDATION_LINK}. If you didn\'t publish this listing, please ignore this e-mail.</p><p>Listing details:</p><p>Contact name: {USER_NAME}<br />Contact e-mail: {USER_EMAIL}</p><p>{ITEM_DESCRIPTION}</p><p>Url: {ITEM_URL}</p><p>Even if you\'re not registered at {WEB_LINK}, you can still edit or delete your listing:</p><p>You can edit your listing by following this link: {EDIT_LINK}</p><p>You can delete your listing by following this link: {DELETE_LINK}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(18,'cs_CZ','{WEB_TITLE} - Registroval se nový uživatel','<p>Dear {WEB_TITLE} admin,</p><p>You\'re receiving this email because a new user has been created at {WEB_LINK}.</p><p>User details:</p><p>Name: {USER_NAME}<br />E-mail: {USER_EMAIL}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(18,'en_US','{WEB_TITLE} - A new user has registered','<p>Dear {WEB_TITLE} admin,</p><p>You\'re receiving this email because a new user has been created at {WEB_LINK}.</p><p>User details:</p><p>Name: {USER_NAME}<br />E-mail: {USER_EMAIL}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(19,'cs_CZ','{WEB_TITLE} - Nový dotaz','<p>Dobrý den {CONTACT_NAME}!</p><p>{USER_NAME} ({USER_EMAIL}, {USER_PHONE}) vám zanechal zprávu:</p><p>{COMMENT}</p><p>S pozdravem,</p><p>{WEB_LINK}</p>'),
(19,'en_US','{WEB_TITLE} - Someone has a question for you','<p>Hi {CONTACT_NAME}!</p><p>{USER_NAME} ({USER_EMAIL}, {USER_PHONE}) left you a message:</p><p>{COMMENT}</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(20,'cs_CZ','{WEB_TITLE} - Nový komentář u vaší položky','<p>There\'s a new comment on the listing: <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Author: {COMMENT_AUTHOR}<br />Author\'s email: {COMMENT_EMAIL}<br />Title: {COMMENT_TITLE}<br />Comment: {COMMENT_TEXT}</p><p>{WEB_LINK}</p>'),
(20,'en_US','{WEB_TITLE} - Someone has commented on your listing','<p>There\'s a new comment on the listing: <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a>.</p><p>Author: {COMMENT_AUTHOR}<br />Author\'s email: {COMMENT_EMAIL}<br />Title: {COMMENT_TITLE}<br />Comment: {COMMENT_TEXT}</p><p>{WEB_LINK}</p>'),
(21,'cs_CZ','{WEB_TITLE} - Úspěch s vytvořením administrátorského účtu!','<p> Ahoj {ADMIN_NAME},</p><p> Admin {WEB_LINK} vytvořil pro tebe účet , </p> <ul> <li> Uživatelské jméno: {USERNAME} </li> <li> Heslo:.! {PASSWORD} </li> </ul> <p> zde můžete otevřít admin panel {WEB_ADMIN_LINK} </p><p> Děkujeme!</p><p> S pozdravem, </p>'),
(21,'en_US','{WEB_TITLE} - Success creating admin account!','<p>Hi {ADMIN_NAME},</p><p>The admin of {WEB_LINK} has created an account for you,</p><ul><li>Username: {USERNAME}</li><li>Password: {PASSWORD}</li></ul><p>You can access the admin panel here {WEB_ADMIN_LINK}.</p><p>Thank you!</p><p>Regards,</p>'),
(22,'cs_CZ','{WEB_TITLE} - Vaše reklama brzy skončí','<p>Dobrý den {USER_NAME}, </p><p> Váše položky <a href=\"{ITEM_URL}\"> {ITEM_TITLE} </a> na webu {WEB_LINK} brzy vyprší.'),
(22,'en_US','{WEB_TITLE} - Your ad is about to expire','<p>Hi {USER_NAME},</p><p>Your listing <a href=\"{ITEM_URL}\">{ITEM_TITLE}</a> is about to expire at {WEB_LINK}.'),
(26,'en_US','{WEB_TITLE} - New message from customer','<p>Hi {USER_NAME}</p><p>You have recieved new message from {FROM_NAME}:</p><p>{MESSAGE}</p><p><br/></p><p>Thank you, <br />{WEB_TITLE}</p>'),
(27,'en_US','{WEB_TITLE} - New bank transfer initiated','<p>Hi {CONTACT_NAME}!</p><p>You have just submitted new bank transfer payment with following details:</p><p><br/></p><p>Transaction ID: {TRANSACTION_ID}</p><p>Variable symbol: {VARIABLE_SYMBOL}</p><p>Amount: {PRICE}</p><p>Account to pay: {ACCOUNT}</p><p><br/></p><p>Please transfer funds to our account {ACCOUNT} as soon as possible to speed up process. Once funds are on our account, we complete your payment. Note that bank transfer can take up to 3 business days.</p><p><br/></p><p>Thank you, <br />{WEB_TITLE}</p>'),
(34,'en_US','{WEB_TITLE} - New bank transfer initiated','<p>Hi {CONTACT_NAME}!</p><p>You have just submitted new bank transfer payment with following details:</p><p><br/></p><p>Transaction ID: {TRANSACTION_ID}</p><p>Variable symbol: {VARIABLE_SYMBOL}</p><p>Amount: {PRICE}</p><p>Account to pay: {ACCOUNT}</p><p><br/></p><p>Please transfer funds to our account {ACCOUNT} as soon as possible to speed up process. Once funds are on our account, we complete your payment. Note that bank transfer can take up to 3 business days.</p><p><br/></p><p>Thank you, <br />{WEB_TITLE}</p>'),
(35,'en_US','{WEB_TITLE} - Promote your ad: {ITEM_TITLE}','<p>Hi {CONTACT_NAME}!</p><p>We just published your item {ITEM_URL} on {WEB_TITLE}, you may want to promote it and make it more attractive!</p><p><br/></p><p>{START_PUBLISH}</p><p><strong>Publish fee</strong> - In order to make your ad available to anyone on {WEB_TITLE}, you should complete the process and pay the publish fee.</p><p>{END_PUBLISH}</p><p>{START_IMAGE}</p><p><strong>Image fee</strong> - In order to show images on your listing, you need to pay the image fee.</p><p>{END_IMAGE}</p><p>{START_PREMIUM}</p><p><strong>Make premium</strong> - Make your ad premium and make it to appear on top result of the searches made on {WEB_TITLE}.</p><p>{END_PREMIUM}</p><p>{START_HIGHLIGHT}</p><p><strong>Highlight</strong> - Highlight your ad and make it more attractive.</p><p>{END_HIGHLIGHT}</p><p>{START_MOVETOTOP}</p><p><strong>Move to top</strong> - Move your listing to top and make it to show in top of search results.</p><p>{END_MOVETOTOP}</p><p>{START_REPUBLISH}</p><p><strong>Republish</strong> - Automatically republish/renew your listing in selected periods multiple times.</p><p>{END_REPUBLISH}</p><p><br/></p><p>You can promote your listing in {ACCOUNT_LINK} or on following link: <br />{PROMOTE_LINK}</p><p><br/></p><p>This is an automatic email, if you already did that, please ignore this email.</p><p>Thank you, <br />{WEB_TITLE}</p>'),
(36,'en_US','{WEB_TITLE} - Some promotions has expired on your ad: {ITEM_TITLE}','<p>Hi {CONTACT_NAME}!</p><p>Some promotions on {ITEM_URL} has expired!</p><p><br/></p><p>{START_PREMIUM}</p><p><strong>Premium</strong> - listing is no more premium as paid period has expired.</p><p>{END_PREMIUM}</p><p>{START_HIGHLIGHT}</p><p><strong>Highlight</strong> - listing is no more highlighted as paid period has expired.</p><p>{END_HIGHLIGHT}</p><p>{START_REPUBLISH}</p><p><strong>Republish</strong> - listing has been republished for last time and will not be republished anymore, as paid repeats has been used.</p><p>{END_REPUBLISH}</p><p><br/></p><p>You can promote your listing in {ACCOUNT_LINK} or on following link: <br />{PROMOTE_LINK}</p><p><br/></p><p>This is an automatic email, if you already did that, please ignore this email.</p><p>Thank you, <br />{WEB_TITLE}</p>'),
(37,'en_US','{WEB_TITLE} - Some promotions has expired on your ad: {ITEM_TITLE}','<p>Hi {CONTACT_NAME}!</p><p>Let us inform you, that your membership on {WEB_TITLE} in group {GROUP} has expired!</p><p>You will have no more access to premium content and special discount provided by membership.</p><p>If you would like to continue in membership, you can extend it in {ACCOUNT_LINK} on our site.</p><p><br/></p><p>This is an automatic email, if you already did that, please ignore this email.</p><p>Thank you, <br />{WEB_TITLE}</p>'),
(38,'en_US','{WEB_TITLE} - You got bonus credits','<p>Hi {CONTACT_NAME}!</p><p>Let us inform you, we have just sent you {CREDIT} as a bonus!</p>{GROUP_BONUS}<p>You can use credits to promote your listings or to extend membership.</p><p>To use credits, login to {ACCOUNT_LINK}.</p><p><br/></p><p>This is an automatic email, if you already did that, please ignore this email.</p><p>Thank you, <br />{WEB_TITLE}</p>'),
(39,'en_US','{WEB_TITLE} - Banner review','<p>Hi!</p><p>We just reviewed your banner {BANNER_NAME} and it was {STATUS}.</p><p>Comment: {COMMENT}</p><p><br/></p><p>{START_APPROVED}</p><p>In order to show banner on our site it is required to pay it\'s budget. Please click on following link to initiate payment: <br/>{PAYMENT_LINK}</p><p>{END_APPROVED}</p><p>{START_REJECTED}</p><p>If you are still interested in advertising on our site, please follow the reviewer comment, check our terms and conditions and submit banner again.</p><p>{END_REJECTED}</p><p><br/></p><p>Thank you, <br />{WEB_TITLE}</p>'),
(40,'en_US','{WEB_TITLE} - Order #{ORDER_ID}','<p>Hi {CONTACT_NAME}!</p><p>{START_NEW}</p><p>We have successfully received your order. Our team will do the best to deliver it as soon as possible.</p><p><br/></p><p>{END_NEW}</p><p>{START_PROCESSING}</p><p>Status of your order is <strong>PROCESSING</strong>. We are preparing your order to be shipped.</p><p>{END_PROCESSING}</p><p>{START_SHIPPED}</p><p>Status of your order is <strong>SHIPPED</strong>. Currier will contact you shortly to deliver order to your adress.</p><p>{END_SHIPPED}</p><p>{START_COMPLETED}</p><p>Status of your order is <strong>COMPLETED</strong>. Order has been delivered to you and is now closed.</p><p>{END_COMPLETED}</p><p>{START_CANCELLED}</p><p>Your order has been <strong>CANCELLED</strong>. All funds associated with this order will be send back to your account. We are looking forward for your next order.</p><p>{END_CANCELLED}</p><p>Comment: {COMMENT}</p><p><br/></p><p>Order content:</p><p>{ORDER_CONTENT}</p><p><br/></p><p>If you would like to see your order details, you can check it in {ORDER_LINK} on our site.</p><p><br/></p><p>Thank you, <br />{WEB_TITLE}</p>'),
(41,'en_US','[{WEB_TITLE}] New message: {ITEM_TITLE}','<p>Hi {TO_NAME},</p><p>{FROM_NAME} has sent you new message on your product {ITEM_LINK} and is listed below:<hr></p><p><strong>{THREAD_TITLE}</strong></p><p>{MESSAGE}</p><p><hr></p><p><br/></p><p>You can directly answer <a target=\"_blank\" href=\"{THREAD_LINK}\">clicking here</a>.<p>Remember, older conversations can always be viewed under \"Messages\" in your user account.</p><p></p><p>Thank you, <br />{WEB_TITLE}</p>'),
(42,'en_US','Terms of Service','<p>TERMS OF SERVICE UNDER REVIEW</p>'),
(43,'en_US','Buying and Selling Safety','<p>Buying and Selling Safety Under Review</p>'),
(44,'en_US','Privacy Policy','<p>Privacy Policy Under Review</p>'),
(45,'en_US','How Does it Work','<p>NIMEX (Nigerian Market Extra) is a proudly Nigerian indigenous online marketplace powered by the Nigerian Legion. Our platform is designed to empower vendors at every level — from grassroots traders to established enterprises — by giving them visibility, connecting them to buyers, and driving business growth through technology. </p>\r\n<p> </p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.nairastreet.com/blog/wp-content/uploads/2020/04/account.jpg\" alt=\"\" width=\"942\" height=\"454\" /></p>\r\n<h2> </h2>\r\n<h1>How do you post your stuff on nimex.ng?</h1>\r\n<p> </p>\r\n<p>First, you need to get yourself or your Brand registered on our platform, this is so easy and free, click on register, you can make the process faster by downloading our app on Google play store you can use your Facebook account to log in on nimex.ng by clicking on \" login with FB icon\"</p>\r\n<p>After you successfully registered login into your account. go to your profile to update your mobile number</p>\r\n<p>If you are a business owner or Brand, Please take this opportunity to add your business information by going to Business Profile update your details select your business categories and other things such as time of business operation, Method of payments, and other details which your business offer</p>\r\n<h2> </h2>\r\n<h2><strong>How to Post Your Item on nimex.ng?</strong></h2>\r\n<p>Login to your account, if you are using mobile just click on the Post Ads Button, or if you are on a Desktop computer with a big screen click on the top right corner \" SELL\" select your product / Business categories followed by the details including the attributes If the item you wish to sale has another location you can select your location here otherwise the location you used during the registration will be auto-added</p>\r\n<p>Click on Publish and your Ad will be queued for review if it passes our integrity test, it will be enabled. This is only one time stuff, subsequent times your ad won\'t have to wait that long before appearing.</p>\r\n<p> </p>\r\n<h2><strong>After Posting your Ad</strong></h2>\r\n<p> </p>\r\n<p>Always check nimex.ng from time to time as the visitors might leave you a message, also ensure your number is reachable for possible calls ad transactions. Also, ensure that you ask your clients, customers, to rate your profile this will increase your reputation and trust</p>\r\n<p> </p>\r\n<h1>BOOSTING ADS?</h1>\r\n<p>You can utilize our special promotional feature to make your ads more visible to the world by paying a small fee, the promotional platform works in a way that your ads are pushed to the top of the category, appear on the home page and search pages, depending on the style of promotion you selected, you can also make the color and background of your ad stand out from the crowd all these features make you more visible X10 than when it is ordinary posted </p>\r\n<h1> </h1>'),
(46,'en_US','FAQ','<p>FAQ UPDATE COMING!</p>'),
(47,'en_US','Support: {SITE_NAME}.','<p>Hi <strong>{CONTACT_NAME}</strong>!</p><p>A new Support ticket was submitted, go to the admin section and read the ticket.</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(48,'en_US','Support: {SITE_NAME}.','<p>Hi <strong>{CONTACT_NAME}</strong>!</p><p>A new reply was made to the ticket, go in your dashboard to read the reply.</p><p>Regards,</p><p>{WEB_LINK}</p>'),
(58,'en_US','{WEB_TITLE} - Reservation #{RESERVATION_CODE} created','<p>Hi {RESERVATION_USER_NAME}!</p><p>We have just received your reservation of <b>{BOOKING_TITLE}</b> and is waiting for confirmation from seller!</p><p>Once it is confirmed, we will send you confirmation email.</p><p><br/></p><p>This is an automatic email, if you already did that, please ignore this email.</p><p>Thank you, <br />{WEB_TITLE}</p>'),
(59,'en_US','{WEB_TITLE} - Reservation #{RESERVATION_CODE} created','<p>Hi {RESERVATION_USER_NAME}!</p><p>We have just received your reservation of <b>{BOOKING_TITLE}</b> and it has been confirmed by seller!</p><p><br/></p><p>This is an automatic email, if you already did that, please ignore this email.</p><p>Thank you, <br />{WEB_TITLE}</p>'),
(60,'en_US','{WEB_TITLE} - New reservation #{RESERVATION_CODE} created','<p>Hi {ITEM_USER_NAME}!</p><p>We have just received new reservation on <b>{BOOKING_TITLE}</b> ({ITEM_TITLE}) and is waiting for your confirmation!</p><p>In order to confirm reservation, please login into your account and Confirm or Decline reservation in \"Reservations\" section.</p><p><br/></p><p>This is an automatic email, if you already did that, please ignore this email.</p><p>Thank you, <br />{WEB_TITLE}</p>'),
(61,'en_US','{WEB_TITLE} - Admin: New reservation #{RESERVATION_CODE} created','<p>Hi Admin!</p><p>We have just received new reservation on <b>{BOOKING_TITLE}</b> ({ITEM_TITLE}) and is in status <u>{RESERVATION_STATUS}</u>!</p><p>You may contact seller/customer if needed</p><p>Seller: {ITEM_USER_NAME}, {ITEM_USER_EMAIL}, {ITEM_USER_PHONE}</p><p>Customer: {RESERVATION_USER_NAME}, {RESERVATION_USER_EMAIL}, {RESERVATION_USER_PHONE}</p><p><br/></p><p>This is an automatic email, if you already did that, please ignore this email.</p><p>Thank you, <br />{WEB_TITLE}</p>'),
(62,'en_US','{WEB_TITLE} - Reservation #{RESERVATION_CODE} has been CONFIRMED','<p>Hi {RESERVATION_USER_NAME}!</p><p>Your reservation <u>#{RESERVATION_CODE}</u> on <b>{BOOKING_TITLE}</b> has been <u>CONFIRMED</u>!</p><p>If you have any questions, feel free to contact us.</p><p><br/></p><p>This is an automatic email, if you already did that, please ignore this email.</p><p>Thank you, <br />{WEB_TITLE}</p>'),
(63,'en_US','{WEB_TITLE} - Reservation #{RESERVATION_CODE} has been DECLINED','<p>Hi {RESERVATION_USER_NAME}!</p><p>Your reservation <u>#{RESERVATION_CODE}</u> on <b>{BOOKING_TITLE}</b> has been <u>DECLINED</u>!</p><p>If you have any questions, feel free to contact us.</p><p><br/></p><p>This is an automatic email, if you already did that, please ignore this email.</p><p>Thank you, <br />{WEB_TITLE}</p>'),
(64,'en_US','{WEB_TITLE} - Reservation #{RESERVATION_CODE} has been CANCELLED','<p>Hi {RESERVATION_USER_NAME}!</p><p>Your reservation <u>#{RESERVATION_CODE}</u> on <b>{BOOKING_TITLE}</b> has been <u>CANCELLED</u>!</p><p>If you have any questions, feel free to contact us.</p><p><br/></p><p>This is an automatic email, if you already did that, please ignore this email.</p><p>Thank you, <br />{WEB_TITLE}</p>'),
(65,'en_US','{WEB_TITLE} - Reservation #{RESERVATION_CODE} has been PAID','<p>Hi {ITEM_USER_NAME}!</p><p>Reservation <b>#{RESERVATION_CODE}</b> on <b>{BOOKING_TITLE}</b> ({ITEM_TITLE}) has just been <u>PAID</u>!</p><p>If you have any questions, feel free to contact us.</p><p><br/></p><p>This is an automatic email, if you already did that, please ignore this email.</p><p>Thank you, <br />{WEB_TITLE}</p>'),
(66,'en_US','{WEB_TITLE} - Admin: Reservation #{RESERVATION_CODE} has been PAID','<p>Hi Admin!</p><p>Let us inform you, that reservation <b>#{RESERVATION_CODE}</b> on <b>{BOOKING_TITLE}</b> ({ITEM_TITLE}) has just been <u>PAID</u>!</p><p><br/></p><p>This is an automatic email, if you already did that, please ignore this email.</p><p>Thank you, <br />{WEB_TITLE}</p>'),
(67,'en_US','{WEB_TITLE} - New rating on reservation #{RESERVATION_CODE}','<p>Hi {ITEM_USER_NAME}!</p><p>We have just received new rating on reservation <b>#{RESERVATION_CODE}</b> on <b>{BOOKING_TITLE}</b> ({ITEM_TITLE}).</p><p><b>Rating:</b> {RESERVATION_RATING} (of 5): {RESERVATION_RATING_COMMENT}</p><p><br/></p><p>In case you have questions or you would like to contact customer, please contact us with reservation code and we will do this on behalf of you.</p><p><br/></p><p>This is an automatic email, if you already did that, please ignore this email.</p><p>Thank you, <br />{WEB_TITLE}</p>'),
(70,'en_US','{WEB_TITLE} - Price on listing #{ITEM_ID} has changed','<p>Hi {CONTACT_NAME}!</p> <p>Let us inform you, that price on your favorite listing: <strong>{ITEM_TITLE} (#{ITEM_ID})</strong> has been just changed.</p> <p>Old price: <strong>{OLD_PRICE}</strong><br />New price: <strong>{NEW_PRICE}</strong></p> <p></p> <p>You can check this listing on following URL:<br /><strong><span style=\"color: #1400ff;\">{ITEM_URL}</span></strong></p> <p></p> <p>Regards, <br />{WEB_TITLE}</p>'),
(71,'en_US','{WEB_TITLE} - Your favorite listing #{ITEM_ID} has been removed','<p>Hi {CONTACT_NAME}!</p> <p>Let us inform you, that listing you has favorited: <strong>{ITEM_TITLE} (#{ITEM_ID})</strong> has just been removed.</p> <p>Price on this listing was: <strong>{PRICE}</strong></p> <p></p> <p>This listing has not been actual, it has been sold or it has expired.</p> <p></p> <p>Regards, <br />{WEB_TITLE}</p>'),
(72,'cs_CZ','{WEB_TITLE} - There is problem with backlink placed on your site','<p>Dear Partner!</p> <p>Let us inform you, that we were not able to find link referring to our site: <strong>{YOUR_URL}</strong> on your website <strong>{LINK_URL}</strong>.</p> <p>Please add our link to your site or our cooperation in backlink building will be cancelled. If reason of removing link is maintenance or similar, please inform us about this.</p> <p>Regards, <br />{WEB_TITLE}</p>'),
(72,'en_US','{WEB_TITLE} - There is problem with backlink placed on your site','<p>Dear Partner!</p> <p>Let us inform you, that we were not able to find link referring to our site: <strong>{YOUR_URL}</strong> on your website <strong>{LINK_URL}</strong>.</p> <p>Please add our link to your site or our cooperation in backlink building will be cancelled. If reason of removing link is maintenance or similar, please inform us about this.</p> <p>Regards, <br />{WEB_TITLE}</p>'),
